def solution(stdin: str) -> str:
    n = int(stdin.split()[0])
    a = list(map(int, stdin.split()[1].split()))

    def gcd(x: int, y: int) -> int:
        while y:
            x, y = y, x % y
        return x

    def lcm(x: int, y: int) -> int:
        return x * y // gcd(x, y)

    def is_balanced(heights: list) -> bool:
        if len(heights) == 1:
            return True
        return abs(heights[1] - heights[0]) <= 1 and is_balanced(heights[2:])

    def construct_balanced_circle(heights: list) -> int:
        if not is_balanced(heights):
            return -1

        m = len(heights)
        result = [0] * m

        result[0] = heights[0]

        for i in range(1, m):
            index = i - 1
            while result[index] + 1 < heights[i]:
                index -= 1
            if index == -1:
                break
            result[index + 1] = heights[i]

        return lcm(result[1] - result[0], result[-1] - result[-2])

    if len(a) == n:
        k = n
    else:
        k = max(n, construct_balanced_circle(a))

    result = [0] * k
    for i in range(n):
        result[i] = a[i]

    for _ in range(k - n):
        result.append(min(result))

    return f"{k}\n{result[0]}" + " ".join(str(height) for height in result[1:])

