    balls = [[] for _ in range(N)]

    for _ in range(N):
        ball, color = map(int, stdin().split())
        balls[ball].append(color)

    colors_count = {}
    for i in range(2**K):
        colors_count[i] = 0

    def helper(current_colors, current_count, i, j, left_color, right_color):
        if i == N:
            nonlocal colors_count
            colors_count[current_colors] = max(colors_count[current_colors], current_count)
            return

        for color in balls[i]:
            if color == left_color:
                helper(current_colors | (1 << (left_color + 1)), current_count + 1, i + 1, j, color, right_color)
            elif color == right_color:
                helper(current_colors | (1 << (right_color + 1)), current_count + 1, i + 1, j, left_color, color)
            else:
                helper(current_colors, current_count, i + 1, j, left_color, right_color)

    helper(0, 0, 0, 0, 0, 0)

    return str(colors_count[2**K - 1])

