                if not stack:
                    return False
                stack.pop()
            elif c == '[':
                stack.append(i)
            elif c == ']':
                if not stack:
                    return False
                stack.pop()
            elif c == '{':
                stack.append(i)
            elif c == '}':
                if not stack:
                    return False
                stack.pop()
            else:
                return False
        return not stack

    def find_error(s: str) -> str:
        if not validate_string(s):
            return'syntax error'
        stack = []
        for i, c in enumerate(s):
            if c == '(':
                stack.append(i)
            elif c == ')':
                if not stack:
                    return f'closing parenthesis {i + 1} is not matched'
                stack.pop()
            elif c == '[':
                stack.append(i)
            elif c == ']':
                if not stack:
                    return f'closing square bracket {i + 1} is not matched'
                stack.pop()
            elif c == '{':
                stack.append(i)
            elif c == '}':
                if not stack:
                    return f'closing curly brace {i + 1} is not matched'
                stack.pop()
            else:
                pass
        if not stack:
            return 'ok so far'
        return f'opening delimiter {stack[-1] + 1} is not matched'

    length = int(stdin.split('\n')[0])
