            if n % i == 0:
                return False
        return True

    def modular_exponentiation(base: int, exponent: int, modulus: int) -> int:
        result = 1
        while exponent > 0:
            if exponent % 2 == 1:
                result = (result * base) % modulus
            base = (base * base) % modulus
            exponent //= 2
        return result

    def cyclic_count(size: int, value: int) -> int:
        count = 0
        while value!= 0:
            count += 1
            value = modular_exponentiation(2, value, size)
        return count

