    def bfs(row: int, col: int, word: str, queue: List[Tuple[int, int]]) -> bool:
        if word == lexicographically_smallest_word:
            return True

        if not is_valid(row, col):
            return False

        if board[row][col] == '#':
            return False

        if board[row][col]!= word[0]:
            return bfs(row + 1, col, word, queue)

        queue.append((row, col))

        return (
            bfs(row - 1, col, word, queue)
            or bfs(row, col - 1, word, queue)
            or bfs(row + 1, col, word, queue)
            or bfs(row, col + 1, word, queue)
        )

    lexicographically_smallest_word = ""
    visited = set()

