def solution(stdin: str) -> str:
    n = int(stdin.split()[0])
    distances = [list(map(int, stdin.split()[1:])) for _ in range(n)]

    def bellman_ford(distances):
        n = len(distances)
        prev = [-1] * n
        prev[0] = 0

        for _ in range(n - 1):
            for i in range(n):
                for j in range(n):
                    if j!= i and (prev[j] == -1 or distances[prev[j]][i] < distances[prev[j]][j]):
                        prev[i] = j

        for i in range(n):
            if prev[i] == -1:
                return -1

        return prev

    prev_distances = distances.copy()
    prev_prev_distances = prev_distances.copy()

    for i in range(n):
        prev_distances[i] = [distances[prev[i]][i] for prev in prev_distances]

    prev_prev_distances = bellman_ford(prev_distances)

    if prev_prev_distances == -1:
        return ""

    edges = []
    visited = set()
    stack = [0]

    while stack:
        u = stack.pop()
        if u in visited:
            continue
        visited.add(u)

        for v in range(n):
            if v == u or (prev_prev_distances[u][v]!= -1 and prev_prev_distances[u][v] < prev_prev_distances[u][v + 1]):
                continue

            edges.append((u, v))
            stack.append(v)

    return "\n".join([str(u) + " " + str(v) for u, v in edges])


