    def map_letter(letter: str, key_phrase: str, index: int) -> str:
        key_phrase = key_phrase[::-1]  # reverse the key phrase to enable wraparound
        key_row = key_phrase[index // 5]
        key_col = key_phrase[index % 5]
        row = 'ABCDEFGHIJKLMNOPQRSTUVWXYZ'[ord(letter) - 97]
        col = 'ABCDEFGHIJKLMNOPQRSTUVWXYZ'[ord(row) - 97]

        if key_row == row and key_col == col:
            return 'X'
        elif key_row == row:
            return chr(97 + (ord(col) + 1) % 26)
        elif key_col == col:
            return chr(97 + (ord(row) + 1) % 26)
        else:
            return chr(97 + (ord(row) + ord(col) - ord(row) - ord(col) + 1) % 26)

    def encrypt(plaintext: str) -> str:
        encrypted = ''
        key_index = 0
        for letter in plaintext:
            if letter == 'x':
                encrypted += 'X'
            else:
                encrypted += map_letter(letter, key_phrase, key_index)
                key_index += 1
                if key_index == len(key_phrase):
                    key_index = 0
        return encrypted

    encrypted_text = encrypt(plaintext)
    return encrypted_text.upper()

