    image = [list(row) for row in stdin.split()[1:]]

    def count_islands(x: int, y: int, is_land: bool) -> int:
        visited = set()
        stack = [(x, y)]
        count = 1
        while stack:
            cx, cy = stack.pop()
            if (cx, cy) in visited:
                continue
            visited.add((cx, cy))
            if is_land or (cx - 1, cy) not in visited and image[cx - 1][cy] == 'L':
                stack.append((cx - 1, cy))
            if is_land or (cx + 1, cy) not in visited and image[cx + 1][cy] == 'L':
                stack.append((cx + 1, cy))
            if is_land or (cx, cy - 1) not in visited and image[cx][cy - 1] == 'L':
                stack.append((cx, cy - 1))
            if is_land or (cx, cy + 1) not in visited and image[cx][cy + 1] == 'L':
                stack.append((cx, cy + 1))
            count += 1
        return count

    count_land = count_islands(0, 0, True)
    count_water = count_islands(0, 0, False)
    return str(min(count_land, count_water))

def solution(stdin: str) -> str:
    s, t = stdin.split('\n')
    sticky_keys = set()

    # Count the number of times each character in s corresponds to a sticky key
    for i, key in enumerate(s):
        if key.islower():
            sticky_keys.add(ord(key))

    # Extract the characters from t corresponding to the sticky keys
    result = [t[sticky_keys.index(key)] for key in sticky_keys]

    return ''.join(result)

