def solution(stdin: str) -> str:
    n = int(stdin)
    def collatz_sequence(n: int) -> list[int]:
        if n == 1:
            return [1]
        if n % 2 == 0:
            sequence = collatz_sequence(n // 2) + [n]
        else:
            sequence = collatz_sequence(3 * n + 1) + [n]
        return sequence

    sequence = collatz_sequence(n)
    return str(sum(sequence))

def solution(stdin: str) -> str:
    n = int(stdin.split()[0])
    students = list(map(int, stdin.split()[1:]))

    # First, we need to distribute the exams in each room
    exams = []
    for i in range(n):
        exams.extend(students[:students[i]])
        students = students[students[i]:]

    if not exams:
        return "impossible"

    # Then, we need to distribute the remaining exams evenly
    exams.sort(reverse=True)
    remaining = sum(students)
    exams.extend([0] * (remaining - len(exams)))

    # Finally, we need to make sure that no student receives their own exam to review
    for i in range(n - 1, 0, -1):
        if len(exams) >= students[i]:
            exams.pop(i)
        else:
            break

    if not exams:
        return "impossible"

    return " ".join(map(str, exams))

def solution(stdin: str) -> str:
    lines = stdin.splitlines()
